    [],nt"num_tags": 2,nt"name": "flint-hills-national-wildlife-refuge-annual-narrative-report-calendar-year-1992",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Flint
    Hills National Wildlife Refuge summarizes refuge activities during the 1992 calendar
    year.  The report begins with a summary of the yearu2019s highlights and climatic
    conditions. The report includes a planning section which discusses management plans,
    compliance with environmental and cultural resource mandates, and research and investigations.
     Refuge administration is outlined; information about personal, youth programs,
    other manpower programs, volunteer programs, funding, safety and other items is
    given.  Habitat management is also covered.  Subjects include wetlands, forests,
    croplands, grasslands, grazing, haying, fire management, pest control and water
    rights.  The wildlife section of the report discusses endangered and/or threatened
    species, marsh and water birds, shorebirds, gulls, terns and allied species, raptors,
    other migratory birds, game mammals, other resident wildlife, fisheries resources,
    scientific collections, and disease prevention and control.  The public uses of
    the refuge described in this report include general, outdoor student classrooms,
    interpretive foot trails, interpretive exhibits/demonstrations, other interpretive
    programs, hunting, fishing, wildlife observation, other wildlife oriented recreation,
    picnicking, and law enforcement.  The equipment and facilities section of the report
    provides information about new construction, rehabilitation, major maintenance,
    equipment utilization and replacement, and communications systems.  Items of interest
    are provided at the end.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
